import React from "react";

export const ChildCallback = ({ onClick, text, style }) => (
  <button onClick={onClick} style={style}>
    {text}
  </button>
);

const PropsCallback = ({ value,}) => {
  return (
        <span style={{
          width: '2rem', 
          textAlign: 'center', 
          border: 'none', 
          backgroundColor: 'white', 
          cursor: 'default',
          color: 'orange',
          fontSize: '15px'
        }}>
          {value}
        </span>
  );
};

export default PropsCallback;
